#include "Simulation.h"

#include <queue>

std::queue<SimStep> simSteps;
std::queue<InputStep> inputSteps;

SimStep lastS(0, Vec3f(0, 170, 130), Quaternion(0, 1, 0, 0), Vec3f(0, 135, 0), Quaternion(0, 0, 0, 1));
InputStep lastI(0, false);

SimStep getSimulationStep(Real32 currentSimulationTimestamp) {
	if (currentSimulationTimestamp >= simSteps.front().timestamp) {
		lastS = simSteps.front();
		if (!simSteps.empty()) {
			simSteps.pop();
			return getSimulationStep(currentSimulationTimestamp);
		}
	}
	return lastS;
}

InputStep getInputStep(Real32 currentSimulationTimestamp) {
	if (currentSimulationTimestamp >= inputSteps.front().timestamp) {
		lastI = inputSteps.front();
		if (!inputSteps.empty()) {
			inputSteps.pop();
			return getInputStep(currentSimulationTimestamp);
		}
	}
	return lastI;
}

